import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Offcanvas from 'react-bootstrap/Offcanvas';
import 'bootstrap/dist/css/bootstrap.min.css';
import Style from './Nav.module.css';
import logo from "./finlogo-transformed.png";
import "bootstrap-icons/font/bootstrap-icons.css";

function OffcanvasExample() {
  const expand = 'lg';

  return (
    <Navbar expand={expand} className={`px-5 py-3 ${Style.Nav}`} style={{ borderRadius: '10px', marginLeft: '10%', marginRight: '10%', marginTop: '20px' }}>
      <Container fluid className="justify-content-center">
        <Navbar.Brand href="#" className={Style.logo}>
          <img src={logo} alt="" className={Style.logo_image} />
        </Navbar.Brand>
      </Container>
      <Navbar.Toggle className={Style.Toggle} aria-controls={`offcanvasNavbar-expand-${expand}`} />
      <Navbar.Offcanvas
        id={`offcanvasNavbar-expand-${expand}`}
        aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
        placement="end"
        className={Style.Nav}
      >
        <Offcanvas.Header closeButton className={Style.Toggle_close}>
          <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
            Finazy
          </Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          <Nav className="justify-content-start flex-grow-1 pe-3">
            <Nav.Link href="#action1" className={Style.Link}>About Us</Nav.Link>
            <Nav.Link href="#action2" className={Style.Link}>Testimonials</Nav.Link>
            <Nav.Link href="#action3" className={Style.Link}>Contact Us</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Button variant="outline-success" className={Style.Btn_Search}>Sign In</Button>
            <Button variant="outline-success" className={Style.Btn_Search}>Sign Up</Button>
            <Button variant="outline-success" className={Style.Btn_Search}>Pricing</Button>
          </Form>
        </Offcanvas.Body>
      </Navbar.Offcanvas>
    </Navbar>
  );
}

export default OffcanvasExample;
